function textToEmoji(val) {
    if(val) {
        for (var i = 1; i <= 72; i++) {
            var ni = i - 1;
            var labFace = '[em_' + ni + ']';
            var s = val.indexOf(labFace);
            if (s > -1) {
                var imgs = '<img src="data:image/gif;base64,' + base64_gif[i] + '"  border="0">';
                // val = replaceAllsss(val,labFace, imgs);
                // val =    val.replace(new RegExp(labFace,"gm"),imgs)
                val =    val.split(labFace).join(imgs);

            }
        }
    }
    return val;
}